    "2016-11-25T21:06:13.974345",nt"name": "internet-access-in-u-s-public-schools-2005",nt"isopen":
    true,nt"url": null,nt"notes": "Internet Access in U.S. Public Schools,
    2005 (FRSS 90), is a study that is part of the Fast Response Survey System (FRSS)
    program; program data is available since 1998-99 at <http://nces.ed.gov/surveys/frss/downloads.asp>.
    FRSS 90 (http://nces.ed.gov/surveys/frss/) is a sample survey that provides trend
    analysis on the percent of public schools and instructional rooms with internet
    access and on the ratio of students to instructional computers with Internet access.
    The study was conducted using mailed questionnaires or the option of completing
    the survey via the web. Principals of various public schools were sampled. The study's
    response rate was 86 percent. Key statistics produced from FRSS 90 were the number
    of instructional computers with access to the internet, the types of internet connections,
    technologies and procedures used to prevent student access to inappropriate material
    on the internet, and the availability of hand-held and laptop computers for students
    and teachers. Respondents also provided information on teacher professional development
    on how to integrate the use of the internet into the curriculum and on the use of
    the internet to provide opportunities and information for teaching and learning.",nt"license_title":
